func minimumCost(nums []int) int {
    n := len(nums)
    // dp[i][j] represents the minimum cost to split the first i elements into j subarrays
    dp := make([][]int, n+1)
    for i := range dp {
        dp[i] = make([]int, 4)
        for j := range dp[i] {
            dp[i][j] = 10001 // Initialize with a large number
        }
    }

    dp[0][0] = 0 // Base case: no cost to split 0 elements into 0 subarrays

    for i := 1; i <= n; i++ {
        for j := 1; j <= 3; j++ {
            sum := 0
            for k := i; k >= j; k-- {
                sum += nums[k-1]
                dp[i][j] = min(dp[i][j], dp[k-1][j-1] + nums[k-1])
            }
        }
    }

    return dp[n][3]
}

func min(a, b int) int {
    if a < b {
        return a
    }
    return b
}
